DROP TABLE IF EXISTS `student`;
CREATE TABLE `student`  (
  `uid` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT 'id号',
  `upwd` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '密码',
  `uident` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '身份证号码',
  `uxuehao` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '学号（标识每一位学生）',
  `uname` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '姓名',
  `uage` int(3) NOT NULL DEFAULT '' COMMENT '年龄',
  `usex` varchar(4) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '性别',
  `unicheng` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '昵称(昵称可以为空)',
  `uxueli` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '学历',
  `uschool` varchar(30) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '毕业学校',
  `utel` varchar(14) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '电话',
  `umail` varchar(20) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '邮箱',
  `state` int(1) NOT NULL DEFAULT '' COMMENT '是否是有效用户',
  PRIMARY KEY USING BTREE (`uid`)
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_bin ROW_FORMAT = Compact;

